import React from 'react';
import { ThreeDots } from 'react-loader-spinner';

function Loader() {
    return (
        <ThreeDots
        height="60"
        width="60"
        color='grey'
        ariaLabel='loading'
        offset-md-3
      />
    )
}

export default Loader
